if (1 != 1) {
    let Tone = require("tone")
    let Midi = require("@tonejs/midi")
}

let knownNotes = ["A3", "A4", "A5", "As3", "As4", "B3", "B4", "B5", "C4", "C5", "Cs4", "Cs5", "Cs6", "D4", "D5", "Ds4", "Ds5", "E4", "E5", "F4", "F5", "Fs3", "Fs4", "Fs5", "G3", "G4", "G5", "Gs4", "unknup", "unkndown"]
let target = document.getElementById("target")
function getNoteImagePath(name) {
    name = name.replace("#", "s")
    if (knownNotes.indexOf(name) != -1) {
        return `noteblocks/${name}.png`
    } else {
        return `noteblocks/unkn.png`
    }
}


/** @type {Midi.Midi} */
let midi
document.getElementById('midifile').onchange = (event) => {
    const file = event.target.files[0];
    window.f = file
    target.innerHTML = ""
    parseFile(file)
}

let noteShift = 0
function shiftNotes(add) {
    noteShift += add
    if (midi) {
        generateTracks()
    }
    playTrack(null)
}
let shiftSelector = document.getElementById("snapmode")
function getShiftedNote(midi) {
    midi += noteShift
    switch (shiftSelector.value) {
        case "up":
        case "down":
            if (midi < 54) {
                return 54
            } else if (midi > 85) {
                return 85
            } else if (getNoteImagePath(Tone.Midi(midi).toNote()) != getNoteImagePath("")) {
                return midi
            } else {
                if (shiftSelector.value == "up") {
                    return midi + 1
                } else {
                    return midi - 1
                }
            }
        default:
            return midi
    }
}

let trackTemplate = `
<div class="track">
    <div class="track-header">
        <span class="track-name"></span>
        <button class="track-play">How does it sound?</button>
    </div>
    <div class="track-content"></div>
</div>
`
let tmp = document.createElement("template")
/** @type {HTMLElement} */
function realizeTemplate(tmpl) {
    tmp.innerHTML = tmpl
    // debugger
    return tmp.content.firstElementChild
}

function parseFile(file) {
    //read the file
    const reader = new FileReader();
    reader.onload = function (e) {
        loadMidi(e.target.result)
    };
    reader.readAsArrayBuffer(file);
}

let trackEls = []
let xPosMult = 0
function loadMidi(buf) {
    midi = new Midi(buf);
    console.log(midi)
    noteShift = 0
    generateTracks()
}

/** @param {Event} ev */
function scrollSync(ev) {
    trackEls.forEach(pel => {
        if (!pel) return
        let el = pel.getElementsByClassName("track-content")[0]
        if (el != ev.target) {
            el.scroll(ev.target.scrollLeft, el.scrollTop)
        }
    })
}

// seperated out for ability to modify things
function generateTracks() {
    target.innerHTML = ""
    trackEls = []
    xPosMult = 0.00001
    midi.tracks.forEach(track => {
        let first = track.notes.filter(note => note.ticks != 0)[0]
        let second
        for (i=0; i < 1 && first; i++) {
            second = track.notes.filter(note => note.ticks > first.ticks)[0]
            if (first && second) {
                xPosMult = Math.max(xPosMult, 16/(second.ticks - first.ticks))
            }
            first = second
        }
    })
    midi.tracks.forEach(track => {
        if (!track.notes.length) {
            trackEls.push(null)
            return
        }
        let trackEl = realizeTemplate(trackTemplate)
        trackEl.getElementsByClassName("track-name")[0].innerText = track.name
        trackEl.getElementsByClassName("track-play")[0].onclick = () => playTrack(track)
        let content = trackEl.getElementsByClassName("track-content")[0]
        content.onscroll = scrollSync
        track.notes.forEach(note => {
            let im = document.createElement("img")
            im.style.position = "absolute"
            im.style.left = `${note.ticks*xPosMult}px`
            let midi = getShiftedNote(note.midi)
            // 54 - 85 need to fit
            if (midi < 53) {
                im.style.top = `128px`
                im.src = getNoteImagePath("unkndown")
            } else if (midi > 86) {
                im.style.top = `-4px`
                im.src = getNoteImagePath("unknup")
            } else {
                im.style.top = `${(85-midi)*4}px`
                im.src = getNoteImagePath(Tone.Midi(midi).toNote())
            }
            im.classList.add("track-note")
            content.appendChild(im)
            let expectedmidi = note.midi + noteShift
            if (midi != expectedmidi) {
                let im2 = document.createElement("img")
                im2.style.position = "absolute"
                im2.style.left = Number(im.style.left.replace("px", ""))+9+"px"
                im2.style.top = Number(im.style.top.replace("px", ""))+9+"px"
                if (midi > expectedmidi) {
                    im2.src = "noteblocks/snapup.png"
                } else {
                    im2.src = "noteblocks/snapdown.png"
                }
                im2.classList.add("track-note-shift")
                content.appendChild(im2)
            }
        })
        target.appendChild(trackEl)
        trackEls.push(trackEl)
    })
}

let currentNoteTimings = []
/** @type {Tone.PolySynth} */
let currentSynth
let playingTrack
let now
/** @param {Midi.Track} track */
function playTrack(track) {
    if (currentSynth) {
        currentSynth.disconnect()
    }
    if (playingTrack == track) {
        playingTrack = null
        return
    } else {
        playingTrack = track
    }
    if (!track) return
    currentNoteTimings = []
    // currentSynth = new Tone.PolySynth(Tone.DuoSynth, {
    //     envelope: {
    //         attack: 0.0,
    //         decay: 0.1,
    //         sustain: 0.0,
    //         release: 0.1,
    //     },
    //     harmonicity: 0.5,
    //     // vibratoRate: 20,
    //     // vibratoAmount: 1
    // }).toDestination();
    currentSynth = new Tone.Sampler({
        "D2": "/sounds/NoteBlockD2.ogg",
        "A2": "/sounds/NoteBlockA2.ogg",
        "D3": "/sounds/NoteBlockD3.ogg",
        "A3": "/sounds/NoteBlockA3.ogg",
        "D4": "/sounds/NoteBlockD4.ogg",
    }, () => {
        now = Tone.now() + 0.1;
        let firstNoteTime = track.notes.reduce((m, n) => Math.min(m, n.time), 999)
        console.log(firstNoteTime)
        now -= firstNoteTime
        track.notes.forEach((note, i) => {
            currentSynth.triggerAttackRelease(
                Tone.Midi(getShiftedNote(note.midi)),
                note.duration,
                note.time + now,
                Math.min(0.3, note.velocity)
            );
            currentNoteTimings.push({
                time: note.time + now,
                index: i
            })
        });
    }).toDestination()
}

let gradient = "linear-gradient(90deg, transparent calc(POS - 12px), rgb(36, 71, 169) calc(POS), transparent calc(POS + 1px))"

let lastPlayingEl = null
let lastTime = -999
let autoscrollCheckbox = document.getElementById("autoscroll") || {}
function ticker() {
    lastPlayingEl = trackEls[midi.tracks.indexOf(playingTrack)]?.getElementsByClassName("track-content")?.[0]
    if (lastPlayingEl) {
        let time = (Tone.now() - Tone.context.lookAhead)
        console.log()
        if (lastTime > time) {
            lastTime = -999
        }
        let noteEls = lastPlayingEl.getElementsByClassName("track-note")
        let playing = currentNoteTimings.filter(n => (
            n.time <= time && n.time > lastTime
        ))
        playing.forEach(n => {
            noteEls[n.index]?.animate([
                // keyframes
                { filter: 'brightness(1)' },
                { filter: 'brightness(1.6)' },
                { filter: 'brightness(1)' },
            ], {
                // timing options
                duration: 200,
                iterations: 1,
                easing: "ease-in-out"
            })
        })
        if (playing.length && autoscrollCheckbox.checked) {
            let focus = noteEls[playing.at(-1).index]
            let relPos = Number(focus.style.left.replace("px", "")) - lastPlayingEl.scrollLeft
            if (relPos > lastPlayingEl.clientWidth) {
                let scrolls = Math.floor(relPos/lastPlayingEl.clientWidth)
                lastPlayingEl.scroll(
                    lastPlayingEl.scrollLeft + lastPlayingEl.clientWidth*scrolls,
                    lastPlayingEl.scrollTop
                )
            } else if (relPos < 0) {
                let scrolls = Math.ceil(-relPos/lastPlayingEl.clientWidth)
                lastPlayingEl.scroll(
                    lastPlayingEl.scrollLeft - lastPlayingEl.clientWidth*scrolls,
                    lastPlayingEl.scrollTop
                )
            }
        }
        lastTime = time
    }
}

function tickman() {
    requestAnimationFrame(tickman)
    ticker()
}
requestAnimationFrame(tickman)


function reloadaudio() {
    Tone.setContext(new Tone.Context)
    playingTrack = null
}

